  render() {
    return(
      <header>
          <h1>{this.props.title}</h1>
          {this.props.sub}
      </header>

    );
  }
}






class App extends Component {
 render() { 
   return (
      <div className="App">
        <Subject title="WEB" sub="world wide web!"></Subject>
        <Subject title="React" sub="For UI"></Subject>
        <TOC></TOC>
        <Content title="HTML" desc="HTML is HyperText Markup Language."></Content>
      </div>
    );
  }
}


export default App;
